//SPDX-License-Identifier: MIT
pragma solidity ^0.5.5;

import "@openzeppelin/contracts/crowdsale/validation/PausableCrowdsale.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./interfaces/AggregatorV3Interface.sol";
import "./DMODVesting.sol";

contract DMODCrowdsale is Ownable, PausableCrowdsale {
    using SafeMath for uint256;

    event VestingCreated(address beneficiary, address vestingContract);

    address public dmodToken;
    uint256 public dmodCost;

    uint256 public start;
    uint256 public cliffDuration;
    uint256 public duration;

    AggregatorV3Interface public priceFeed;

    /**
     * @dev Construct a Crowdsale contract
     * @param rate Number of token units a buyer gets per wei
     * @param wallet Address where collected funds will be forwarded to
     * @param token Address of the token being sold
     * @param _dmodCost Cost of DMOD token where 1e18 units represent 1$
     * @param ethpriceFeed Chainlink ETH price feed
     * @param _start Start date in epoch
     * @param _cliffDuration Duration of cliff in seconds
     * @param _duration Vesting period duration in seconds
     */
    constructor(
        uint256 rate,
        address payable wallet,
        IERC20 token,
        uint256 _dmodCost,
        address ethpriceFeed,
        uint256 _start,
        uint256 _cliffDuration,
        uint256 _duration
    ) public Crowdsale(rate, wallet, token) {
        dmodToken = address(token);
        dmodCost = _dmodCost;
        // priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        priceFeed = AggregatorV3Interface(ethpriceFeed);
        start = _start;
        cliffDuration = _cliffDuration;
        duration = _duration;
    }

    /**
     * @dev Override to extend the way in which ether is converted to tokens.
     * @param weiAmount Value in wei to be converted into tokens
     * @return Number of tokens that can be purchased with the specified _weiAmount
     */
    function _getTokenAmount(uint256 weiAmount)
        internal
        view
        returns (uint256)
    {
        // Code for calculating the price of ethereum sent and token to be sent
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        uint256 neth = uint256(price).mul(1e10);
        uint256 dl = neth.mul(weiAmount);
        return dl.div(dmodCost);
    }

    /**
     * @dev Source of tokens. Override this method to modify the way in which the crowdsale ultimately gets and sends
     * its tokens.
     * @param beneficiary Address performing the token purchase
     * @param tokenAmount Number of tokens to be emitted
     */
    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal {
        IERC20 dmodInstance = IERC20(dmodToken);
        DMODVesting dmodVesting =
            new DMODVesting(
                beneficiary,
                start,
                cliffDuration,
                duration,
                false
            );
        emit VestingCreated(beneficiary, address(dmodVesting));
        dmodInstance.transfer(address(dmodVesting), tokenAmount);
    }

    /**
     * @dev Withdraw Remaining Tokens after crowdsale finished
     */
    function withdrawRemainingTokens() external onlyOwner {
        IERC20 dmodInstance = IERC20(dmodToken);
        uint256 balance = dmodInstance.balanceOf(address(this));
        dmodInstance.transfer(owner(), balance);
    }
}

